import React from 'react';
import styles from './Contato.module.css';
import foto from '../img/contato.jpg';

const Contato = () => {
  return (
    <section className={styles.contato}>
      <img src={foto} alt="máquina de escrever" />
      <div>
        <h1>Contato</h1>
      </div>
    </section>
  );
};

export default Contato;
